#include <stdio.h>

int product1(int arr[])
{
        int size=sizeof arr/sizeof arr[0];
        int p=1;
        int i;
        for(i=0;i<p;i++)
                p=p**(arr+i);
        return p;
}

int product2(int *arr)
{
        int size=sizeof arr/sizeof arr[0];
        int p=1;
        int i;
        for(i=0;i<p;i++)
                p=p**(arr+i);
        return p;
}

int main(int argc, char const *argv[])
{
        int arr[]={1,2,3,4};
        printf("%d\n",product1(arr));
        printf("%d\n",product2(arr));
